import { MainLayout } from '../Layout/MainLayout'
import { useEffect } from 'react'
export default function Index() {
  useEffect(async () => {
    const response2 = fetch('http://wp-test/wp-json/custom-routes/v1/tablemotor')
    const tableData = await response2.json()
    console.log(tableData)
  }, [])

  return (
      <MainLayout>
        <div className={'flexWrapper'}>
          <div className="container">
            <h1>Hello Next.JS!</h1>
          </div>
        </div>
      </MainLayout>
  )
}
